
self.addEventListener("install", listener => {
  console.log("WORKER: install event in progress.");
});
self.addEventListener("activate", listener => {
  console.log('WORKER: activate event in progress.');
});
self.addEventListener("fetch", listener => {
  const resources = [
    {
      path: '/assets/i18n/en.json',
      contentHeaders: { 'Content-Type': 'text/html' },
      data: '',
    },
    {
      path: '/nerd-normal.ttf',
      contentHeaders: { 'Content-Type': 'application/font-snft', 'Accept-Ranges': 'bytes', 'Content-Length': '949936'},
      data: `Url path /nerd-normal.ttf `,
    },
    {
      path: '/arcade-normal.otf',
      contentHeaders: { 'Content-Type': 'application/font-snft', 'Accept-Ranges': 'bytes', 'Content-Length': '949936'},
      data: ``
    }
  ]

  const request = listener.request;
  const url = (new URL(request.url));
  console.log("Intercepted call to ", url.pathname);

  if (url.pathname == "/") {
    // Don't intercept hits to the homepage
    return;
  }

  const params = new URLSearchParams(url.search);
  const info = {
    url: request.url,
    method: request.method,
    path: url.pathname,
    params: Array.from(params.entries())
  };

  let requestDecodedData = Object.values(resources).filter(value => value.path === url.pathname)[0]

  console.info(`!-WORKER from uri (${request.url}): Fetching from filepath for ${url.pathname} using LLER (Lazy Loaded Encoded Resources)`);
  
  if (requestDecodedData) {
    listener.respondWith(new Response(
      atob(requestDecodedData.data), {
      headers: requestDecodedData.contentHeaders
    }));
  }

});